import React from 'react'
import ProductList from "../components/ProductList/ProductList"

const StockPage = () => {
  const many = 10000
  return (
    <>
      <div>{many}</div>
    {/* @ts-ignore */}
      <ProductList />
    </>
  )
}

export default StockPage
